INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 2, 126001, "クリア", 40011, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 325, 5, 1);
